Description:
Torba z kolekcji R, charakteryzuje się najwyższej jakości wykonaniem. Materiał "R" jest odporny na wodę co pozwala na szybkie pozbycie się zabrudzeń. Wnętrze torby pokryte jest delikatną pianką, która zabezpiecza sprzęt przed różnego typu uszkodzeniami mechanicznymi. Dzięki odpowiednim wymiarom i dobrze wykrojonym wnętrzem (duża główna komora i 3 kieszonki boczne) pomieszczą się w niej odpowiednie ilości sprzętu. Dodatkową zaletą torby są mocne zamki oraz solidny, regulowany pasek wykonany z pianki, dzięki czemu transport sprzętu będzie niezwykle komfortowy.



<strong>Wymiary: </strong>62x35x32



&nbsp;

